import React from 'react';
import './App.css';

const courses = [
  "Website Development", "Graphics", "Data Analytics",
];

function App(props) {
  const coursesData = courses.map((course) => {<li>{course}</li>});
  return (
    <div className=' container'>
      <h1 className=' text-green-700'>Available Courses</h1>
      <ul>{coursesData}</ul>
    </div>
  );
}
export default App;
